// ignore_for_file: camel_case_types, non_constant_identifier_names

import 'dart:core';

import 'package:flutter/material.dart';

void main() {
  runApp(const MainApp());
}

class MainApp extends StatelessWidget {
  const MainApp({super.key});

  @override
  Widget build(BuildContext context) {
    return const MaterialApp(
      home: assi3(),
    );
  }
}

class assi3 extends StatefulWidget {
  const assi3({super.key});

  @override
  State<assi3> createState() => _assi3State();
}

class _assi3State extends State<assi3> {
  int? index = 0;
  final List<String> imglist = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
  ];
  void nextimg() {
    setState(() {
      index = index! + 1;
    });
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
        appBar: AppBar(
          title: const Text("Display Image"),
        ),
        body: Center(
            child: Column(
          mainAxisAlignment: MainAxisAlignment.center,
          children: [
            Image.network(
              imglist[index!],
              height: 300,
              width: 300,
            ),
            const SizedBox(
              height: 20,
            ),
            ElevatedButton(onPressed: nextimg, child: const Text("NextImg")),
            const SizedBox(
              height: 20,
            ),
            ElevatedButton(
                onPressed: () {
                  setState(() {
                    index = 0;
                  });
                },
                child: const Text("Reset")),
          ],
        )));
  }
}
